import React from 'react';
import ListVegetarianRecipes from './components/ListVegetarianRecipes';
import GetRecipesByCuisine from './components/GetRecipesByCuisine';
import GetMostCommonIngredients from './components/GetMostCommonIngredients';
import AddRecipeWithRating from './components/AddRecipeWithRating';
import './App.css';

function App() {
    return (
        <div className="App">
            <header className="App-header">
                <h1>Recipe App</h1>
            </header>
            <main>
                <GetRecipesByCuisine />
                <GetMostCommonIngredients />
                <AddRecipeWithRating />
            </main>
        </div>
    );
}

export default App;
